import { Link } from "react-router-dom";

const BlogList = ({ blogs, title, handleDel }) => {
  //   const blogs = props.blogs;
  return (
    <div className="blog-list">
      <h1>{title}</h1>
      {blogs.map((blog) => (
        <div className="blog-preview" key={blog.id}>
          <Link>
          </Link>
          
        </div>
      ))}
    </div>
  );
};

export default BlogList;
